drop table country;
drop table player;
drop table cup;
drop table stadium;
drop table rosterspot;
drop table countryparticipation;
drop table game;
create table country(id int not null, name varchar(64), crestURL varchar(512), primary key (id));
create table player(id int not null, name varchar(64), birthdate varchar(64), primary key (id));
create table cup(year int not null, hostCID int, winnerCID int, primary key (year));
create table stadium(id int not null, name varchar(64), city varchar(64), cid varchar(64), primary key (id));
create table rosterspot(year int not null, pid int not null, cid int, position varchar(10), goals int, pkScores int, primary key (year, pid));
create table countryparticipation(cid int not null, year int not null, result int, primary key (cid, year));
create table game(id int not null, year int not null, date varchar(64), time varchar(64), grID varchar(10), round varchar(64), stadID int, winnerCID int, loserCID int, wGoals int, lGoals int, pkScore varchar(10), primary key (id, year));







